import React from 'react';

export default function Cube (props) {
  return (
    <div className='cube-three-side' style={{ height: '100px', width: '100px', position: 'relative', display:'inline-block', margin: '11px 0 0 0'}}>
      <div className='face face-front'
        style={{
          position: 'absolute',
          left: '0%',
          top: '25%',
          height: '50px',
          width: '44.3px',
          fontSize: '20px',
          border:'solid',
          borderWidth:'3.5px',
          borderRadius: '4px 2px 2px 2px',
          transformStyle: 'preserve-3d',
          backgroundColor: props.frontColor,
          transform: 'skew(0deg, 30deg)'
        }}
      >{props.front}
      </div>
      <div className='face face-side'
        style={{
          position: 'absolute',
          left: '50%',
          top: '25%',
          height: '50px',
          width: '44.3px',
          border:'solid',
          borderWidth:'3.5px',
          borderRadius: '2px 4px 2px 2px',
          backgroundColor: props.sideColor,
          transformStyle: 'preserve-3d',
          transform: 'skew(0deg, -30deg)'
        }}
      >{props.side}
      </div>
      <div className='face face-top'
        style={{
          position: 'absolute',
          left: '13%',
          top: '-23%',
          height: '66px',
          width: '68px',
          border:'solid',
          borderWidth:'3.5px',
          borderRadius: '2px 5px 2px 5px',
          transformStyle: 'preserve-3d',
          backgroundColor: props.topColor,
          transform: 'rotateX(55deg) rotateZ(45deg)'
        }}
      >{props.top}
      </div>
    </div>
  );
}
